// Services.js
import React from 'react';
import { Link } from 'react-router-dom'; // Import Link for navigation
import Navbar from './Navbar';
import Footer from './Footer';
import './Services.css';

const Services = () => {
    return (
        <div className="services-page">
            <Navbar />
            <div className="container">
                <h1 className="main-heading">Our Services Dashboard</h1>
                <div className="dashboard-grid">
                    <div className="dashboard-item">
                        <Link to="/case-management">
                            <h2>Case Management</h2>
                            <p>Organize and manage case files efficiently with our intuitive file management system.</p>
                        </Link>
                    </div>
                    <div className="dashboard-item">
                        <Link to="/client-communication">
                            <h2>Client Communication</h2>
                            <p>Secure messaging and communication tools for effective client interactions.</p>
                        </Link>
                    </div>
                    {/* Add more service items with Link components */}
                </div>
            </div>
            <Footer />
        </div>
    );
};

export default Services;
